\u043b\u0430\u0442\u043e\u0439 \u0437\u0430 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442?\n\u0414\u0430 \u0435\u0449\u0451 \u0438 \u0442\u0430\u043a\u0438\u0445, \u0447\u0442\u043e\u0431\u044b \u0441\u0430\u043c\u0438 \u043f\u0440\u0438\u0445\u043e\u0434\u0438\u043b\u0438 \u043a \u0432\u0430\u043c \u0432 \u043e\u0444\u0438\u0441, \u043d\u0443 \u043b\u0438\u0431\u043e \u043e\u0447\u0435\u043d\u044c \u0436\u0434\u0430\u043b\u0438 \u0432\u0430\u0448\u0435\u0433\u043e \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u043f\u043e \u043f\u0440\u043e\u0434\u0430\u0436\u0430\u043c \u043d\u0430 \u0441\u0432\u043e\u0435\u0439 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438.\n\u2800\u2800\u2800\u2800\u2800\n\ud83d\udcb6 \u0415\u0441\u043b\u0438 \u0432\u0441\u0442\u0440\u0435\u0447\u0430 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u2014 \u0432\u044b \u043f\u043b\u0430\u0442\u0438\u0442\u0435 \u0437\u0430\u0440\u0430\u043d\u0435\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0443\u044e \u0446\u0435\u043d\u0443. \u041d\u0435 \u0441\u043e\u0441\u0442\u043e\u0438\u0442\u0441\u044f \u2014 \u043d\u0435 \u043f\u043b\u0430\u0442\u0438\u0442\u0435.\n\u2800\u2800\u2800\u2800\u2800\n\u041d\u0435\u0442, \u044d\u0442\u043e \u043d\u0435 \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u0437\u0430\u043a\u043b\u044e\u0447\u0438\u0442\u044c \u043f\u0430\u0440\u0438.\n\u2800\u2800\u2800\u2800\u2800\n\ud83d\ude80 \u042d\u0442\u043e \u0440\u0435\u0430\u043b\u044c\u043d\u0430\u044f \u0443\u0441\u043b\u0443\u0433\u0430 \u00ab\u041d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u0432\u0441\u0442\u0440\u0435\u0447 \u0441 \u043a\u043b\u0438\u0435\u043d\u0442\u0430\u043c\u0438 \u0441 \u043e\u043f\u043b\u0430\u0442\u043e\u0439 \u0437\u0430 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u00bb, \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u043c\u044b \u0440\u0430\u0434\u044b \u043f\u0440\u0435\u0437\u0435\u043d\u0442\u043e\u0432\u0430\u0442\u044c.\n\u2800\u2800\u2800\u2800\u2800\nRocketCall \u2014 \u043e\u0434\u0438\u043d \u0438\u0437 \u043d\u0435\u043c\u043d\u043e\u0433\u0438\u0445 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 call-\u0446\u0435\u043d\u0442\u0440\u043e\u0432, \u043a\u0442\u043e \u0433\u043e\u0442\u043e\u0432 \u043d\u0430\u0437\u043d\u0430\u0447\u0430\u0442\u044c \u0432\u0441\u0442\u0440\u0435\u0447\u0438 \u043a\u0430\u043a \u0441 \u044e\u0440\u0438\u0434\u0438\u0447\u0435\u0441\u043a\u0438\u043c\u0438 \ud83d\udcbc, \u0442\u0430\u043a \u0438 \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u0438\u043c\u0438 \u043b\u0438\u0446\u0430\u043c\u0438 \ud83d\udc6b \u043f\u043e \u0432\u0441\u0435\u0439 \u0441\u0442\u0440\u0430\u043d\u0435!\n\u2800\u2800\u2800\u2800\u2800\n\ud83c\udfaf \u041d\u0430\u0448\u0430 \u0446\u0435\u043b\u044c:\n\u041d\u0435 \u043f\u0440\u043e\u0441\u0442\u043e \u043f\u0435\u0440\u0435\u0434\u0430\u0442\u044c \u043a\u043e\u043d\u0442\u0430\u043a\u0442\u044b \u0437\u0430\u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043e\u0432\u0430\u043d\u043d\u043e\u0433\u043e \u043a\u043b\u0438\u0435\u043d\u0442\u0430 \u0434\u043b\u044f \u0434\u0430\u043b\u044c\u043d\u0435\u0439\u0448\u0435\u0433\u043e \u0432\u0437\u0430\u0438\u043c\u043e\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u0441 \u0412\u0430\u0448\u0438\u043c \u043e\u0442\u0434\u0435\u043b\u043e\u043c \u043f\u0440\u043e\u0434\u0430\u0436, \u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u043f\u0440\u0438\u0432\u0435\u0441\u0442\u0438 \u0442\u0451\u043f\u043b\u043e\u0433\u043e \u043a\u043b\u0438\u0435\u043d\u0442\u0430 \u0432 \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u043e\u043c \u0432\u0438\u0434\u0435 \u0432 \u0412\u0430\u0448\u0443 \u0444\u0438\u0440\u043c\u0443 \u2014 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u0442\u044c \u0432\u0441\u0442\u0440\u0435\u0447\u0443.\n\u2800\u2800\u2800\u2800\u2800\n\u0423\u0441\u043b\u0443\u0433\u0430 \u00ab\u041d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435 \u0432\u0441\u0442\u0440\u0435\u0447 \u0441 \u043a\u043b\u0438\u0435\u043d\u0442\u0430\u043c\u0438\u00bb \u043e\u0442 RocketCall:\n\u2604\ufe0f \u041e\u043f\u043b\u0430\u0442\u0430 \u0437\u0430 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442 \u2014 \u0437\u0430 \u043f\u0440\u043e\u0432\u0435\u0434\u0451\u043d\u043d\u044b\u0435 \u0432\u0441\u0442\u0440\u0435\u0447\u0438\n\u2604\ufe0f \u0422\u043e\u0447\u043d\u044b\u0435 \u043a\u043b\u0438\u0435\u043d\u0442\u0441\u043a\u0438\u0435 \u0431\u0430\u0437\u044b \u043f\u043e \u0432\u0430\u0448\u0438\u043c \u043a\u0440\u0438\u0442\u0435\u0440\u0438\u044f\u043c\n\u2604\ufe0f \u0420\u0435\u0430\u043b\u044c\u043d\u044b\u0435 \u0442\u0451\u043f\u043b\u044b\u0435 \u043a\u043b\u0438\u0435\u043d\u0442\u044b, \u0430 \u043d\u0435 \u043f\u0440\u043e\u0441\u0442\u043e \u043b\u0438\u0434\u044b\n\u2604\ufe0f \u0415\u0436\u0435\u0434\u043d\u0435\u0432\u043d\u044b\u0435 \u043e\u0442\u0447\u0451\u0442\u044b \u0438 \u043e\u043d\u043b\u0430\u0439\u043d \u043c\u043e\u043d\u0438\u0442\u043e\u0440\u0438\u043d\u0433 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u043e\u0432\n\u2800\u2800\u2800\u2800\u2800\n\ud83d\udd25\ud83d\udd25\ud83d\udd25 \u041f\u043e\u0441\u0447\u0438\u0442\u0430\u0439\u0442\u0435 \u043e\u043a\u0443\u043f\u0430\u0435\u043c\u043e\u0441\u0442\u044c \u041d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u0432\u0441\u0442\u0440\u0435\u0447 \u0434\u043b\u044f \u0441\u0432\u043e\u0435\u0433\u043e \u0431\u0438\u0437\u043d\u0435\u0441\u0430 \u0438 \u043e\u0437\u043d\u0430\u043a\u043e\u043c\u044c\u0442\u0435\u0441\u044c \u0441 \u043d\u0430\u0448\u0438\u043c\u0438 \u043a\u0435\u0439\u0441\u0430\u043c\u0438 \u043d\u0430 \u0441\u0430\u0439\u0442\u0435 \u2014 \u0441\u0441\u044b\u043b\u043a\u0430 \u0432 \u043f\u0440\u043e\u0444\u0438\u043b\u0435 \u2934\n\u2800\u2800\u2800\u2800\u2800\n#RocketCall #\u043f\u0440\u043e\u0434\u0443\u043a\u0442\u044b_RocketCall"}}]},"edge_media_to_comment":{"count":1},"comme 440\u0438\u0447\u0438\u043d\u0430\u043c:\n\u2800\u2800\u2800\u2800\u2800\n\u23f31. \u0423 \u043d\u0430\u0441 \u043d\u0435\u0442 \u043c\u0438\u043d\u0443\u0442\u043d\u043e\u0439 \u0442\u0430\u0440\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u0438 \n\u041d\u0430\u0448\u0438 \u0437\u0430\u043a\u0430\u0437\u0447\u0438\u043a\u0438 \u043f\u043b\u0430\u0442\u044f\u0442 \u0437\u0430 \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u044b\u0445 \u043f\u0440\u0438\u0432\u0435\u0434\u0435\u043d\u043d\u044b\u0445 \u043a\u043b\u0438\u0435\u043d\u0442\u043e\u0432, \u0430 \u043d\u0435 \u0437\u0430 \u043f\u0440\u043e\u0446\u0435\u0441\u0441 \u0438\u0445 \u043f\u0440\u0438\u0432\u043b\u0435\u0447\u0435\u043d\u0438\u044f, \u043a\u0430\u043a \u044d\u0442\u043e \u0432\u0441\u0451 \u0435\u0449\u0451 \u043f\u0440\u0438\u043d\u044f\u0442\u043e \u043d\u0430 \u0440\u044b\u043d\u043a\u0435 \u0442\u0435\u043b\u0435\u043c\u0430\u0440\u043a\u0435\u0442\u0438\u043d\u0433\u0430.\n\u2800\u2800\u2800\u2800\u2800\n\ud83c\udfaf 2. \u0412\u044b \u0441\u0430\u043c\u0438 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u0435\u0442\u0435 \u043a\u0440\u0438\u0442\u0435\u0440\u0438\u0438 \u0441\u0432\u043e\u0435\u0439 \u0446\u0435\u043b\u0435\u0432\u043e\u0439 \u0430\u0443\u0434\u0438\u0442\u043e\u0440\u0438\u0438 \n\u0418\u043c\u0435\u043d\u043d\u043e \u043f\u043e\u044d\u0442\u043e\u043c\u0443 \u043d\u0430\u0448\u0438 \u0437\u0430\u043a\u0430\u0437\u0447\u0438\u043a\u0438 \u043f\u043e\u043b\u0443\u0447\u0430\u044e\u0442 \u0442\u043e\u043b\u044c\u043a\u043e \u0442\u0435\u0445 \u043f\u043e\u0442\u0435\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0445 \u043a\u043b\u0438\u0435\u043d\u0442\u043e\u0432, \u043a\u043e\u043c\u0443 \u0442\u043e\u0447\u043d\u043e \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u0435\u043d \u0438\u0445 \u043f\u0440\u043e\u0434\u0443\u043a\u0442, \u0438 \u043a\u0442\u043e \u0433\u043e\u0442\u043e\u0432 \u043a \u0434\u0430\u043b\u044c\u043d\u0435\u0439\u0448\u0438\u043c \u043f\u0435\u0440\ \u0435\u0440\u044f\u044e\u0442 \u043d\u0430\u043c \u043f\u0440\u0438\u0432\u043b\u0435\u0447\u0435\u043d\u0438\u0435 \u043d\u043e\u0432\u044b\u0445 \u043a\u043b\u0438\u0435\u043d\u0442\u043e\u0432 \u0432 \u0441\u0432\u043e\u0438 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u043f\u043e \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u0438\u043c \u043f\u0440\u0438\u0447\u0438\u043d\u0430\u043c:\n\u2800\u2800\u2800\u2800\u2800\n\u23f31. \u0423 \u043d\u0430\u0441 \u043d\u0435\u0442 \u043c\u0438\u043d\u0443\u0442\u043d\u043e\u0439 \u0442\u0430\u0440\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u0438 \n\u041d\u0430\u0448\u0438 \u0437\u0430\u043a\u0430\u0437\u0447\u0438\u043a\u0438 \u043f\u043b\u0430\u0442\u044f\u0442 \u0437\u0430 \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u044b\u0445 \u043f\u0440\u0438\u0432\u0435\u0434\u0435\u043d\u043d\u044b\u0445 \u043a\u043b\u0438\u0435\u043d\u0442\u043e\u0432, \u0430 \u043d\u0435 \u0437\u0430 \u043f\u0440\u043e\u0446\u0435\u0441\u0441 \u0438\u0445 \u043f\u0440\u0438\u0432\u043b\u0435\u0447\u0435\u043d\u0438\u044f, \u043a\u0430\u043a \u044d\u0442\u043e \u0432\u0441\u0451 \u0435\u0449\u0451 \u043f\u0440\u0438\u043d\u044f\u0442\u043e \u043d\u0430 \u0440\u044b\u043d\u043a\u0435 \u0442\u0435\u043b\u0435\u043c\u0430\u0440\u043a\u0435\u0442\u0438\u043d\u0433\u0430.\n\u2800\u2800\u2800\u2800\u2800\n\ud83c\udfaf 2. \u0412\u044b \u0441\u0430\u043c\u0438 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u0435\u0442\u0435 \u043a\u0440\u0438\u0442\u0435\u0440\u0438\u0438 \u0441\u0432\u043e\u0435\u0439 \u0446\u0435\u043b\u0435\u0432\u043e\u0439 \u0430\u0443\u0434\u0438\u0442\u043e\u0440\u0438\u0438 \n\u0418\u043c\u0435\u043d\u043d\u043e \u043f\u043e\u044d\u0442\u043e\u043c\u0443 \u043d\u0430\u0448\u0438 \u0437\u0430\u043a\u0430\u0437\u0447\u0438\u043a\u0438 \u043f\u043e\u043b\u0443\u0447\u0430\u044e\u0442 \u0442\u043e\u043b\u044c\u043a\u043e \u0442\u0435\u0445 \u043f\u043e\u0442\u0435\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0445 \u043a\u043b\u0438\u0435\u043d\u0442\u043e\u0432, \u043a\u043e\u043c\u0443 \u0442\u043e\u0447\u043d\u043e \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u0435\u043d \u0438\u0445 \u043f\u0440\u043e\u0434\u0443\u043a\u0442, \u0438 \u043a\u0442\u043e \u0433\u043e\u0442\u043e\u0432 \u043a \u0434\u0430\u043b\u044c\u043d\u0435\u0439\u0448\u0438\u043c \u043f\u0435\u0440\u0435\u0433\u043e\u0432\u043e\u0440\u0430\u043c \u0434\u043b\u044f \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u044f \u0441\u0434\u0435\u043b\u043a\u0438. \u0412\u0441\u0435 \u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043d\u0438\u044f \u043f\u043e \u0442\u0451\u043f\u043b\u044b\u043c \u043a\u043b\u0438\u0435\u043d\u0442\u0430\u043c \u043e\u0442\u0440\u0430\u0436\u0430\u0435\u043c \u0432 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0435.\n\u2800\u2800\u2800\u2800\u2800\n\u2600 3. \u041f\u0435\u0440\u0435\u0434\u0430\u0451\u043c \u043d\u0435 \u043f\u0440\u043e\u0441\u0442\u043e \u041b\u0438\u0434\u043e\u0432 \u2014 \u043f\u0435\u0440\u0435\u0434\u0430\u0451\u043c \u0442\u0451\u043f\u043b\u044b\u0445 \u043a\u043b\u0438\u0435\u043d\u0442\u043e\u0432 \n\u0412\u044b \u0431\u0443\u0434\u0435\u0442\u0435 \u043f\u043e\u043b\u0443\u0447\u0430\u0442\u044c \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0438\u0445 \u0442\u0451\u043f\u043b\u044b\u0445 \u043a\u043b\u0438\u0435\u043d\u0442\u043e\u0432 \u2014 \u0442\u0435\u0445, \u043a\u0442\u043e \u043e\u0437\u043d\u0430\u043a\u043e\u043c\u0438\u043b\u0441\u044f \u0441 \u0432\u0430\u0448\u0438\u043c \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u043e\u043c \u0438 \u0447\u044c\u0438 \u0432\u043e\u0437\u0440\u0430\u0436\u0435\u043d\u0438\u044f \u043c\u044b \u0443\u0436\u0435 \u043e\u0442\u0440\u0430\u0431\u043e\u0442\u0430\u043b\u0438. \u0412\u0430\u043c \u043e\u0441\u0442\u0430\u043d\u0435\u0442\u0441\u044f \u0442\u043e\u043b\u044c\u043a\u043e \u0432\u044b\u0439\u0442\u0438 \u043d\u0430 \u0441\u0432\u044f\u0437\u044c \u0441 \u044d\u0442\u0438\u043c\u0438 \u043a\u043b\u0438\u         <script type="text/javascript">
(function(){
  function normalizeError(err) {
    var errorInfo = err.error || {};
    var getConfigProp = function(propName, defaultValueIfNotTruthy) {
      var propValue = window._sharedData && window._sharedData[propName];
      return propValue ? propValue : defaultValueIfNotTruthy;
    };
    var windowUrl = window.location.href;
    var errUrl = err.url || windowUrl;
    return {
      line: err.line || errorInfo.message || 0,
      column: err.column || 0,
      name: 'InitError',
      message: err.message || errorInfo.message || '',
      script: errorInfo.script || '',
      stack: errorInfo.stackTrace || errorInfo.stack || '',
      timestamp: Date.now(),
      ref: windowUrl.indexOf('direct') >= 0 ? 'direct' : windowUrl,
      deployment_stage: getConfigProp('deployment_stage', ''),
      frontend_env: getConfigProp('frontend_env', 'prod'),
      rollout_hash: getConfigProp('rollout_hash', ''),
      is_prerelease: window.__PRERELEASE__ || false,
      bundle_variant: getConfigProp('bundle_variant', null),
      request_url: errUrl.indexOf('direct') >= 0 ? 'direct' : errUrl,
      response_status_code: errorInfo.statusCode || 0
    }
  }
  window.addEventListener('load', function(){
    if (window.__bufferedErrors && window.__bufferedErrors.length) {
      if (window.caches && window.caches.keys && window.caches.delete) {
        window.caches.keys().then(function(keys) {
          keys.forEach(function(key) {
            window.caches.delete(key)
          })
        })
      }
      window.__bufferedErrors.map(function(error) {
        return normalizeError(error)
      }).forEach(function(normalizedError) {
        var request = new XMLHttpRequest();
        request.open('POST', '/client_error/', true);
        request.setRequestHeader('Content-Type', 'application/json; charset=utf-8');
        request.send(JSON.stringify(normalizedError));
      })
    }
  })
}());
</script>
